`) AS `fullname`,`u_file`.`comment` AS `comment`,concat('/',`u_file`.`createusername`,`u_file`.`lastupdateusername`,`u_file`.`deleteusername`,`u_file`.`parentpathname`,`u_file`.`name`,`u_file`.`suffix`,`u_file`.`comment`) AS `searchdata` from `u_file` where (`u_file`.`isdelete` = 0);

