-- ----------------------------
-- Function structure for queryDeptAndChildren
-- ----------------------------
DROP FUNCTION IF EXISTS `queryDeptAndChildren`;
delimiter ;;
CREATE FUNCTION `queryDeptAndChildren`(areaId INT)
 RETURNS varchar(4000) CHARSET utf8
BEGIN
DECLARE sTemp VARCHAR(4000);
DECLARE sTempChd VARCHAR(4000);

SET sTemp='$';
SET sTempChd = CAST(areaId AS CHAR);

WHILE sTempChd IS NOT NULL DO
SET sTemp= CONCAT(sTemp,',',sTempChd);
SELECT GROUP_CONCAT(id) INTO sTempChd FROM u_department WHERE FIND_IN_SET(parentId,sTempChd) > 0;
END WHILE;
RETURN sTemp;
END
;;
delimiter ;

-- ----------------------------
-- Function structure for queryDeptAndParents
-- ----------------------------
DROP FUNCTION IF EXISTS `queryDeptAndParents`;
delimiter ;;
CREATE FUNCTION `queryDeptAndParents`(areaId INT)
 RETURNS varchar(4000) CHARSET utf8
BEGIN
DECLARE sTemp VARCHAR(4000);
DECLARE sTempChd VARCHAR(4000);

SET sTemp='$';
SET sTempChd = CAST(areaId AS CHAR);
SET sTemp = CONCAT(sTemp,',',sTempChd);

SELECT parentId INTO sTempChd FROM u_department WHERE id = sTempChd;
WHILE sTempChd <> 0 DO
SET sTemp = CONCAT(sTemp,',',sTempChd);
SELECT parentId INTO sTempChd FROM u_department WHERE id = sTempChd;
END WHILE;
RETURN sTemp;
END
;;
